    {
      title: "My second",
      body: "lorem ipsum",
      author: "Dora",
      id: 2,
    },
    { title: "My third website", body: "lorem ipsum...", author: "Ida", id: 3 },
  ]);

  return (
    <div className="home">
      <BlogList />
    </div>
  );
};

export default Home;
